import XCTest
import CNKit

class TransportDepartureTests: XCTestCase {
    func testDecoding() {
        let json = departureJSON.data(using: .utf8)!

        let decoded = try! JSONDecoder().decode(PublicTransport.self, from: json)
        XCTAssertEqual(decoded.description, "Hauptbahnhof  16:16 Uhr")
        XCTAssertEqual(decoded.departures.count, 10)

        let lockwitz = decoded.departures.first!
        XCTAssertEqual(lockwitz.line, "66")
        XCTAssertEqual(lockwitz.direction, "Lockwitz")
        XCTAssertEqual(lockwitz.eta, 0)
        XCTAssertEqual(lockwitz.mode, .bus)

        let pirna = decoded.departures[8]
        XCTAssertEqual(pirna.line, "S 1")
        XCTAssertEqual(pirna.direction, "Pirna")
        XCTAssertEqual(pirna.eta, 3)
        XCTAssertNil(pirna.mode)
    }

    func testFetch() {
        let e = expectation(description: "get data")

        let mup = "Münchner Platz"
        PublicTransport.fetch(forStop: mup) { result in
            guard let departures = result.success else {
                XCTFail("got error: \(result)")
                e.fulfill()
                return
            }

            XCTAssert(departures.description.contains("Münchner Platz"))
            e.fulfill()
        }

        waitForExpectations(timeout: 5)
    }
}

